import styled from 'styled-components';

export const Appwrapper = styled.div`
background: white;
width: 100;
min-height: 60vh;
justify-content: center;
align-items: center;
border-radius: 6px;
box-shadow: 0px 2px 6px 2px #888888;
borderBottomRightRadius: '10px',
borderBottomLeftRadius: '10px',
margin-bottom: 60px;
`
